Saya sudah buat pipe seperti ini, cuman saat di jala kan terjadi kesalahan di stage build in docker nya.  Kira" solusi nya apa ya?

events {
    worker_connections 1024;
}
http {
  upstream hello {
    ip_hash;
    server goservice-1:8081;
    server goservice-2:8082;
    server goservice-3:8083;
    server goservice-4:8084;
  }

  server_tokens off;
  server {
    listen 80;
    root  /var/www;

    server_name hello-world.test;

    location / {
      proxy_set_header X-Forwarded-For  $remote_addr;
      proxy_set_header Host             $http_host;
      proxy_pass http://hello;
    }

    # Media: images, icons, video, audio, HTC
    location ~* \.(?:jpg|jpeg|gif|png|ico|cur|gz|svg|svgz|mp4|ogg|ogv|webm|htc)$ {
      expires 1d;
      access_log off;
      add_header Cache-Control "public";
    }

    # CSS and Javascript
    location ~* \.(?:css|js)$ {
      expires 1d;
      access_log off;
      add_header Cache-Control "public";
    }
  }
}

